class objx {
  constructor(id_, _firstName, _location) {
    let id = id_;
    let firstName = _firstName;
    let location = _location;
  }
}

export default function getListStudents() {
  let list = [
    [1, "Guillaume", "San Francisco"],
    [2, "James", "Columbia"],
    [5, "Serena", "San Francisco"]
  ];
  let returnList = [];

  for (let x of list) {
    console.log(x);
    returnList.push({ id: x[0], firstName: x[1], location: x[2] });
  }
  return returnList;
}
